import { useState } from "react";
import axios from "axios";
import { Input } from "../../components/Input";
import { Image } from "./Image";

const Register = () => {

  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div className="h-screen px-10 flex flex-col justify-center max-w-md m-auto lg:grid grid-cols-2  lg:px-0 lg:w-full lg:max-w-7xl lg:overflow-hidden">
      {/* images */}
      <Image />

      {/* form */}
      <section className="lg:p-[20%]">
        
        <h1 className="text-3xl font-semibold">Welcome Back.</h1>
        <p className="text-gray-400">let's continue with us</p>

        <form action="" className="flex flex-col justify-center">
          <section className="grid grid-cols-2 gap-3 ">
            <Input
              type="text"
              placeholder="First Name"
              value={firstName}
              onChange={(e) => setFirstName(e.target.value)}
            />

            <Input
              type="text"
              placeholder="Last Name"
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
            />
          </section>

          <Input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />

          <Input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />

          <section className="flex justify-center items-center text-sm mt-10 text-gray-400">
            <input type="checkbox" name="agree" className="mr-3" />
            <p>
              I accept <a href="http://google.com">Terms & Condition</a>.
            </p>
          </section>

          <input type='submit' className="mt-10 bg-blue-500 text-white px-3 py-3 rounded-lg ">
            Register
          </input>
        </form>
      </section>
    </div>
  );
};

export default Register;
